import React from 'react'
import {
    Link
} from 'react-router-dom'
import {
    Row,
    Col,
    Image,
    ListGroup,
    Button,
    Card
} from 'react-bootstrap'
import jobs from '../jobs'

function JobScreen({
    match
}) {
    const job = jobs.find((p) => p.Id == match.params.Id)
    return ( <
        div >
        <
        Link to = '/'
        className = 'btn btn-light my-3' > Go Back < /Link> <
        Row >
        <
        Card.Title as = "div" >
        <
        h3 > {
            job.JobTitle
        } < /h3> <
        /Card.Title> <
        /Row> <
        Row >
        <
        Card.Text as = "div" >
        <
        h3 > {
            job.CompanyName
        } < /h3> <
        /Card.Text> <
        /Row> <
        Row >
        <
        Card.Text as = "div" >
        <
        h3 > {
            job.Location
        } < /h3> <
        /Card.Text> <
        /Row> <
        /div>
    )
}

export default JobScreen
